export default async function parseFile(clubData: any) {
  console.log(clubData);
  let rows = clubData.map((club: any) => {
    return club.families.map((family: any) => {
    return [
      club.name,
      family.name,
      family.fee
    ]
  })
  })



  console.log(rows);
}
